import React from 'react';
import styled from 'styled-components';

const Div = styled.div`
    display: flex;
    flex-direction: column;
`

const Category = () => {
    return (
        <div>
            <span>장르</span>
            <span>등급</span>
            <span>제작사</span>
            <span>평점</span>
        </div>
    );
};

export default Category;
